import styled from 'styled-components';
import Background from '../../assets/pattern1.svg'

const Container = styled.div`
  height:100vh;
  width: 100vw;
  background-image: url(${Background});
  background-size: 100%;
`;

const Logo = styled.div`
  height: 100vh;
  justify-content: center;
  display: flex;
`;

const Float = styled.div`
  position: absolute;
  top: 20px;
  color: #e0c8ff;
  & > div {
    position: relative;
    width: 100%;
    height: 100%;
    padding: 20px;
    .bg {
      width: 100%;
      height: 100%;
      position: absolute;
      top: 0px;
      left: 0px;
    }
    .title {
      font-weight: 600;
      span {
        font-weight: 300;
      }
    }
  }
`

export {
  Container,
  Logo,
  Float
}
